    public int Day { get; set; }
    public int Month { get; set; }
    public int Year { get; set; }

    public string[] Months { get; set; } =
    {
        "Январь",
        "Февраль",
        "Март",
        "Апрель",
        "Май",
        "Июнь",
        "Июль",
        "Август",
        "Сентябрь",
        "Октябрь",
        "Ноябрь",
        "Декабрь"
    };

    public DateTime DateModel { get; set; }

    protected override void OnInitialized()
    {
        Day = 0;
        Month = 0;
        Year = 0;

        DateModel = new DateTime();

        Task.Run(() => { UpdateDate(); });
        Task.WaitAll();
    }

    public async Task UpdateDate()
    {
        string DateValue = string.Format("{0}.{1}.{2}", Day == 0 ? "-" : Day.ToString(), Month == 0 ? "-" : Month.ToString(), Year == 0 ? "-" : Year.ToString());
        await JSRuntime.InvokeVoidAsync("updateDate", DateValue);
    }

    public Task DateDayChanged(ChangeEventArgs e)
    {
        Day = Convert.ToInt32(e.Value.ToString());
        DateModel = new DateTime(DateModel.Year, DateModel.Month, Day);
        return UpdateDate();
    }

    public Task DateMonthChanged(ChangeEventArgs e)
    {
        Month = Convert.ToInt32(e.Value.ToString());
        DateModel = new DateTime(DateModel.Year, Month, DateModel.Day);
        return UpdateDate();
    }

    public Task DateYearChanged(ChangeEventArgs e)
    {
        Year = Convert.ToInt32(e.Value.ToString());
        DateModel = new DateTime(Year, DateModel.Month, DateModel.Day);
        return UpdateDate();
    }

